INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (17814, 10, 0, "うん、そうだよ。\n【王宮騎士団（NIGHTMARE）】\nと少年から、またひとつ成長した\nトモちゃんにプレゼントだ。", 11, 0, 17814070, 1, 104711, 0.5, 1);
