INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (27814, 10, 0, "ちがう！\nこれは其方を祝うために用意したのだ！\nと、とにかく……\n誕生日おめでとう、クウカ。", 11, 0, 27814073, 1, 105311, 0.5, 1);
