INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (27814, 10, 0, "お、お誕生日\nおめでとうございます、クウカさん。\nせ、せっかく、ケーキを用意したので、\nみんなでこれを食べませんか……？", 11, 0, 27814078, 1, 105511, 0.5, 1);
