INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (28414, 10, 0, "もちろんだよ。\n誕生日おめでとう、マツリちゃん。\nこの間の予防注射もきちんと受けてたし\n大人にまた一歩近づいたね♪", 11, 0, 28414068, 1, 103711, 0.5, 1);
