INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (32114, 10, 0, "今さら気にするくらいなら、\n普段からしっかりやればいいのに。\n……なんてお小言はさておき、\nお誕生日おめでとう、リンちゃん♪", 11, 0, 32114070, 1, 105211, 0.5, 1);
