INSERT INTO `v1_5c9a1631235b57eba026eca0a088bafeddc3da277174db997d7c49d8a6b46d51` VALUES (38614, 10, 0, "今日は、私の誕生日を\nお祝いしてくれてありがとう。\nケーキを食べる前に、\n一つだけ質問してもいいかしら？", 11, 0, 38614069, 1, 105111, 0.5, 1);
